window.Wsfly = window.Wsfly || {};

/*===========================================
 =消息弹窗
 =作者：Wsfly.com
 =版本：V1.0
 =地址：http://wsfly.com/CodeShareDetail.aspx?id=24
 =参数说明：
 =msg：消息内容
 =seconds：多少秒后隐藏(移除)
 =showBG：是否显示背景
 =type：类型 1-消息；2-成功；3-错误；4-等待；5-确认窗口
 =okCallback：确认回调
 =cancelCallback：取消回调
 =closeCallback：关闭回调
 ===========================================*/
Wsfly.Tips = {
    Opts: {
        tipsBox: null,      //弹出框
        isInited: false,    //是否初始
        timer: null,        //定时器
        isShow: false,    //是否显示
        isShowSeconds: false,                //是否显示计时
        isShowBackground: true,             //是否要背景层
        isTransparencyEffect: false,        //是否透明效果
        okCallback: function () { },          //确认回调事件
        cancelCallback: function () { },    //取消回调事件
        infoImage: "data:image/png;base64,",
        successImage: "data:image/png;base64,",
        errorImage: "data:image/png;base64,",
        waitImage: "data:image/gif;base64,",
        confirmImage: "data:image/png;base64,"
    },
    Info: function (msg, seconds, showBG, closeCallback) {
        //消息
        if (seconds == undefined) seconds = 2;
        Wsfly.Tips.Show(1, msg, seconds, showBG, null, null, closeCallback);
    },
    Ok: function (msg, seconds, showBG, closeCallback) {
        //成功
        Wsfly.Tips.Success(msg, seconds, showBG, closeCallback);
    },
    Success: function (msg, seconds, showBG, closeCallback) {
        //成功
        if (seconds == undefined) seconds = 1;
        Wsfly.Tips.Show(2, msg, seconds, showBG, null, null, closeCallback);
    },
    Error: function (msg, seconds, showBG, closeCallback) {
        //错误
        if (seconds == undefined) seconds = 3;
        Wsfly.Tips.Show(3, msg, seconds, showBG, null, null, closeCallback);
    },
    Wait: function (msg, closeCallback) {
        //等待
        Wsfly.Tips.Show(4, msg, 0, true, null, null, closeCallback);
    },
    Confirm: function (msg, seconds, okCallback, cancelCallback, closeCallback) {
        //确认
        Wsfly.Tips.Show(5, msg, seconds, true, okCallback, cancelCallback, closeCallback);

        //绑定事件  Enter-确认  Esc-取消
        Wsfly.Tips.BindEvent(document, "keydown", Wsfly.Tips.ConfirmKeydown);
    },
    Show: function (type, msg, seconds, showBG, okCallback, cancelCallback, closeCallback) {
        //显示
        //是否已经显示
        if (Wsfly.Tips.Opts.isShow) Wsfly.Tips.Remove();

        //显示秒数
        var secondHtml = "";
        if (seconds && seconds > 2 && Wsfly.Tips.Opts.isShowSeconds) {
            secondHtml = "     <div id='WsflyTips_CT_Sen'>" + seconds + "</div>";
        }

        //获取IE版本
        var ieVersion = Wsfly.Tips.GetIEVersion();
        if (ieVersion >= 6 && ieVersion <= 8) {
            Wsfly.Tips.Opts.infoImage = "/Resources/Images/Tag.Tips/info.png";
            Wsfly.Tips.Opts.successImage = "/Resources/Images/Tag.Tips/success.png";
            Wsfly.Tips.Opts.errorImage = "/Resources/Images/Tag.Tips/error.png";
            Wsfly.Tips.Opts.waitImage = "/Resources/Images/Tag.Tips/wait.png";
            Wsfly.Tips.Opts.confirmImage = "/Resources/Images/Tag.Tips/confirm.png";
        }

        //图标
        var iconHtml = "";
        if (type > 0 && type < 6) {
            switch (type) {
                case 1: iconHtml = Wsfly.Tips.Opts.infoImage; break;
                case 2: iconHtml = Wsfly.Tips.Opts.successImage; break;
                case 3: iconHtml = Wsfly.Tips.Opts.errorImage; break;
                case 4: iconHtml = Wsfly.Tips.Opts.waitImage; break;
                case 5: iconHtml = Wsfly.Tips.Opts.confirmImage; break;
            }

            iconHtml = "<img width=\"32px\" height=\"32px\" src=\"" + iconHtml + "\" />&nbsp; ";
        }

        //确认按钮
        var confirmBtns = "";
        if (okCallback && (typeof (okCallback) == "function")) {
            //确认按钮
            confirmBtns += "<button id=\"WsflyTips_CT_Btns_Ok\">确定</button>";
            Wsfly.Tips.Opts.okCallback = okCallback;
        }
        if (cancelCallback && (typeof (cancelCallback) == "function")) {
            //取消按钮
            confirmBtns += "<button id=\"WsflyTips_CT_Btns_Cancel\">取消</button>";
            Wsfly.Tips.Opts.cancelCallback = cancelCallback;
        }
        if (confirmBtns != "") {
            confirmBtns = "     <div class='WsflyTips_CT_Btns'>" + confirmBtns + "</div>";
        }

        //添加CSS
        if (!Wsfly.Tips.Opts.isInited) {
            //初始化
            var css = "" +
                           "    .WsflyTips{ position:fixed; z-index:9999; left:0px; top:0px; width:100%; height:100%; text-align:center; background-color: rgba(0,0,0,0.5); font-family:'Trebuchet MS', 'Lucida Sans Unicode', 'Lucida Grande', 'Lucida Sans', Arial, sans-serif;}" +
                           "    .WsflyTips .WsflyTips_CT_Box{ float:left; position:relative; left:50%; top:50%; }" +
                           "    .WsflyTips .WsflyTips_CT_Box .WsflyTips_CT_Txt{ position:relative; left:-50%; top:-30px; background:#fff; color:#666; font-weight:bold; font-size:16px; padding:10px 40px; height:40px; line-height:40px; background:#fff; -moz-border-radius: 5px; -webkit-border-radius: 5px; border-radius: 5px; box-sizing:content-box; white-space:nowrap;}" +
                           "    .WsflyTips .WsflyTips_CT_Box .WsflyTips_CT_Txt{ filter:alpha(opacity=100 finishopacity=50 style=1 startx=0,starty=0,finishx=0,finishy=150) progid:DXImageTransform.Microsoft.gradient(startcolorstr='#F3F3F3',endcolorstr='#DADADA',gradientType=0);" +
                           "                                                    -ms-filter:alpha(opacity=100 finishopacity=50 style=1 startx=0,starty=0,finishx=0,finishy=150) progid:DXImageTransform.Microsoft.gradient(startcolorstr='#F3F3F3',endcolorstr='#DADADA',gradientType=0);/*IE8*/	" +
                           "                                                    background:-moz-linear-gradient(top, #FFFFFF, #DADADA);  " +
                           "                                                    background:-webkit-gradient(linear, 0 0, 0 bottom, from(#FFFFFF), to(#DADADA));  " +
                           "                                                    background:-o-linear-gradient(top, #FFFFFF, #DADADA); " +
                           "                                                    background:linear-gradient(to bottom, #FFFFFF, #DADADA);" +
                           "                                                  }" +
                           "    .WsflyTips .WsflyTips_CT_Box .WsflyTips_CT_Txt img{ vertical-align:middle; margin-top:-4px; position:relative; filter:alpha(opacity=50); -moz-opacity:0.5; -khtml-opacity: 0.5; opacity: 0.5;  }" +
                           "    .WsflyTips .WsflyTips_CT_Box #WsflyTips_CT_Sen{ position:relative; left:-50%; top:-30px; color:#111;}" +
                           "    .WsflyTips .WsflyTips_CT_Box .WsflyTips_CT_Btns{ position:relative; left:-50%; top:-20px; color:#111; text-align:center; overflow:hidden; margin-bottom:15px;}" +
                           "    .WsflyTips .WsflyTips_CT_Box .WsflyTips_CT_Btns button{ padding:10px 20px; font-size:14px; background:#444; color:#ddd;-moz-border-radius: 5px; -webkit-border-radius: 5px; border-radius: 5px; cursor:pointer; margin-right:5px; border-width:0;}" +
                           "    .WsflyTips .WsflyTips_CT_Box .WsflyTips_CT_Btns button#WsflyTips_CT_Btns_Cancel{ background:#aaa; color:#333}" +
                           "    .WsflyTips .WsflyTips_CT_Box .WsflyTips_CT_Btns button:hover," +
                           "    .WsflyTips .WsflyTips_CT_Box .WsflyTips_CT_Btns button#WsflyTips_CT_Btns_Cancel:hover{ background:#000; color:#eee;}" +
                           "    .NoneBG{ position:fixed; z-index:999; left:50%; top:50%; width:auto; height:auto; text-align:center; background-color:transparent; font-family:'Trebuchet MS', 'Lucida Sans Unicode', 'Lucida Grande', 'Lucida Sans', Arial, sans-serif;}" +
                           "    .NoneBG .WsflyTips_CT_Box{ float:left; position:relative; left:0; top:0; }" +
                           "    .NoneBG .WsflyTips_CT_Box .WsflyTips_CT_Txt{ -moz-box-shadow:2px 2px 5px #333333; -webkit-box-shadow:2px 2px 5px #333333; box-shadow:1px 1px 2px #333333; }" +

                            (Wsfly.Tips.Opts.isTransparencyEffect ?
                           "    .WsflyTips .WsflyTips_CT_Box .WsflyTips_CT_Txt{ background:rgba(255,255,255,0.8); color:#333; box-shadow:1px 1px 2px #333333; border:solid 1px #ccc;}" : "") +

                           "";

            var style = document.createElement("style");
            style.setAttribute("type", "text/css");
            style.innerHTML = css;
            document.head.appendChild(style);
            Wsfly.Tips.Opts.isInited = true;
        }

        //提示框
        var divWsflyTips = document.createElement("div");
        divWsflyTips.setAttribute("class", "WsflyTips");

        //是否显示背景层
        if (!Wsfly.Tips.Opts.isShowBackground || !showBG) {
            divWsflyTips.setAttribute("class", "WsflyTips NoneBG");
        }

        //HTML
        var html = "<div class='WsflyTips_CT_Box'>" +
                    "     <div class='WsflyTips_CT_Txt'>" + iconHtml + msg + "</div>" +
                    confirmBtns +
                    secondHtml +
                    "</div>";

        //提示框HTML
        divWsflyTips.innerHTML = html;

        //添加到Body
        document.body.appendChild(divWsflyTips);

        //提示对象
        Wsfly.Tips.Opts.tipsBox = divWsflyTips;
        //已经显示
        Wsfly.Tips.Opts.isShow = true;
        //聚焦
        Wsfly.Tips.Opts.tipsBox.focus();

        //确认
        if (confirmBtns != "") {
            if (Wsfly.Tips.IsFunction(okCallback)) {
                //确认按钮
                var btnOk = document.getElementById("WsflyTips_CT_Btns_Ok");
                Wsfly.Tips.BindEvent(btnOk, "click", function () {
                    //移除提示
                    Wsfly.Tips.Remove();
                    //解除事件
                    Wsfly.Tips.RemoveEvent(document, "keydown", Wsfly.Tips.ConfirmKeydown);
                    //回调
                    okCallback();
                });
            }
            if (Wsfly.Tips.IsFunction(cancelCallback)) {
                //取消按钮
                var btnCancel = document.getElementById("WsflyTips_CT_Btns_Cancel");
                Wsfly.Tips.BindEvent(btnCancel, "click", function () {
                    //移除提示
                    Wsfly.Tips.Remove();
                    //解除事件
                    Wsfly.Tips.RemoveEvent(document, "keydown", Wsfly.Tips.ConfirmKeydown);
                    //回调
                    cancelCallback();
                });
            }
        }

        //定时器
        if (seconds && seconds > 0) {
            //定时移除
            var runSeconds = 0;
            Wsfly.Tips.Opts.timer = window.setInterval(function () {
                //加1秒
                runSeconds++;

                //到达指定时间
                if (runSeconds == seconds) {
                    if (Wsfly.Tips.IsFunction(closeCallback)) {
                        //关闭回调
                        closeCallback();
                    }
                    //移除提示
                    if (Wsfly != undefined) Wsfly.Tips.Remove();
                    return;
                }
                if (seconds > 2 && Wsfly.Tips.Opts.isShowSeconds) {
                    //当大于2秒才显示倒计时
                    document.getElementById("WsflyTips_CT_Sen").innerHTML = (seconds - runSeconds);
                }
            }, 1000);
        }
    },
    Hide: function () {
        //隐藏
        Wsfly.Tips.Remove();
    },
    Remove: function () {
        //移除
        //是否显示
        if (!Wsfly.Tips.Opts.isShow) return;

        //定时器
        if (Wsfly.Tips.Opts.timer) {
            window.clearInterval(Wsfly.Tips.Opts.timer);
            Wsfly.Tips.Opts.timer = null;
        }

        //提示框
        if (Wsfly.Tips.Opts.tipsBox != null) {
            document.body.removeChild(Wsfly.Tips.Opts.tipsBox);
            Wsfly.Tips.Opts.tipsBox = null;
        }
    },
    ConfirmKeydown: function (e) {
        //确认绑定事件
        if (e.keyCode == 13) {
            //回车事件
            Wsfly.Tips.Remove();

            //解除事件
            Wsfly.Tips.RemoveEvent(document, "keydown", Wsfly.Tips.ConfirmKeydown);

            if (Wsfly.Tips.IsFunction(Wsfly.Tips.Opts.okCallback)) {
                //回调
                Wsfly.Tips.Opts.okCallback();
            }
        }
        else if (e.keyCode == 27) {
            //Esc事件
            Wsfly.Tips.Remove();

            //解除事件
            Wsfly.Tips.RemoveEvent(document, "keydown", Wsfly.Tips.ConfirmKeydown);

            if (Wsfly.Tips.IsFunction(Wsfly.Tips.Opts.cancelCallback)) {
                //回调
                Wsfly.Tips.Opts.cancelCallback();
            }
        }
    },
    BindEvent: function (obj, ev, fn) {
        //绑定事件
        if (obj.attachEvent) {
            obj.attachEvent('on' + ev, fn);
        }
        else {
            obj.addEventListener(ev, fn, false);
        }
    },
    RemoveEvent: function (obj, ev, fn) {
        //解除事件
        if (obj.detachEvent) {
            obj.detachEvent('on' + ev, fn);
        }
        else {
            obj.removeEventListener(ev, fn, false);
        }
    },
    IsFunction: function (value) {
        //是否有值
        if (value == null || value == undefined) return false;
        //是否函数
        return (typeof (value) == "function");
    },
    GetIEVersion: function () {
        //获取IE版本
        if (navigator.appName == "Microsoft Internet Explorer" && navigator.appVersion.split(";")[1].replace(/[ ]/g, "") == "MSIE6.0") {
            return 6;
        }
        else if (navigator.appName == "Microsoft Internet Explorer" && navigator.appVersion.split(";")[1].replace(/[ ]/g, "") == "MSIE7.0") {
            return 7;
        }
        else if (navigator.appName == "Microsoft Internet Explorer" && navigator.appVersion.split(";")[1].replace(/[ ]/g, "") == "MSIE8.0") {
            return 8;
        }
        else if (navigator.appName == "Microsoft Internet Explorer" && navigator.appVersion.split(";")[1].replace(/[ ]/g, "") == "MSIE9.0") {
            return 9;
        }

        return 0;
    }
};